import React from 'react';
import TopBar from '../Components/MainPage/TopBar';
import ShowCase from '../Components/MainPage/ShowCase'

const MainPage = () => {
    const [logged, setLog] = useState(false);
    return (
        <div>
            <TopBar logged='logged'/>
            <ShowCase />
        </div>
    )

}

export default MainPage
